INSERT INTO `cv_template` VALUES (1,'cvTemplate','<div class=\"wrapper\">\n     <div class=\"resume\">\n         <div class=\"left\">\n             <div class=\"img_holder\">\n                 <img [src]=\"dataCV.value.file\" alt=\"picture\">\n             </div>\n             <div class=\"contact_wrap pb\">\n                 <div class=\"title\">\n                     Liên Hệ\n                 </div>\n                 <div class=\"contact\">\n                     <ul>\n                         <li>\n                             <div class=\"li_wrap\">\n                                 <div class=\"icon\"> <i class=\"fas fa-phone\"></i></div>\n                                 <div class=\"text\">{{dataCV.value.phoneNumber}}</div>\n                             </div>\n                         </li>\n                         <li>\n                             <div class=\"li_wrap\">\n                                 <div class=\"icon\"><i class=\"fas fa-envelope\" ></i></div>\n                                 <div class=\"text\">{{dataCV.value.email}}</div>\n                             </div>\n                         </li>\n                         <li>\n                             <div class=\"li_wrap\">\n                                 <div class=\"icon\"><i class=\"fas fa-calendar\" ></i></div>\n                                 <div class=\"text\">{{dataCV.value.birthDate | date: \'dd/MM/yyyy\'}}</div>\n                             </div>\n                         </li>\n                         <li>\n                             <div class=\"li_wrap\">\n                                 <div class=\"icon\"><i class=\"fas fa-map-signs\" ></i></div>\n                                 <div class=\"text\">17 street, jerusalem, Israel</div>\n                             </div>\n                         </li>\n                     </ul>\n                 </div>\n             </div>\n             <div class=\"skills_wrap pb\">\n                 <div class=\"title\">\n                     Kĩ Năng\n                 </div>\n                 <div class=\"skills\">\n                     <ul>\n                         <li *ngFor=\"let skill of dataCV.value.skills; let i = index\">\n                             <div class=\"li_wrap\">\n                                 <div class=\"text\">{{skill.skillName}}</div>\n                             </div>\n                         </li>\n                     </ul>\n                 </div>\n             </div>\n             <div class=\"hobbies_wrap pb\">\n                 <div class=\"title\">\n                     Sở Thích\n                 </div>\n                 <div class=\"hobbies\">\n                     <ul>\n                         <li *ngFor=\"let hobby of dataCV.value.hobbies\">\n                             <div class=\"li_wrap\">\n                                 <div class=\"text\">{{hobby}}</div>\n                             </div>\n                         </li>\n                     </ul>\n                 </div>\n             </div>\n         </div>\n         <div class=\"right\">\n             <div class=\"header\">\n                 <div class=\"name_role\">\n                     <div class=\"name\">\n                         {{dataCV.value.firstName}} {{dataCV.value.lastName}}\n                     </div>\n                     <div class=\"role\">\n                         {{dataCV.value.headline}}\n                     </div>\n                 </div>\n                 <div class=\"about\">\n                     {{dataCV.value.description}}\n                 </div>\n             </div>\n             <div class=\"right_inner\">\n                 <div class=\"exp\">\n                     <div class=\"title\">\n                         Kinh nghiệm\n                     </div>\n                     <div class=\"exp_wrap\">\n                         <ul>\n                             <li *ngFor=\"let experience of dataCV.value.experiences\">\n                                 <div class=\"li_wrap\">\n                                     <div class=\"date\">\n                                         {{experience.startDate | date: \'yyyy\'}} - {{experience.endDate ? (experience.endDate | date: \'yyyy\') : \"Hiện tại\"}}\n                                     </div>\n                                     <div class=\"info\">\n                                         <p class=\"info_title\">\n                                             {{experience.position}}\n                                         </p>\n                                         <p class=\"info_com\">\n                                            {{experience.company}} - {{experience.location}}<br>\n                                         </p>\n                                         <p class=\"info_cont\">\n                                             {{experience.industry ? (\"- Chuyên ngành : \" + experience.industry) : \"\"}}<br>\n                                             {{experience.skills ? (\"- Kĩ năng sử dụng : \" + experience.skills) : \"\"}}<br>\n                                             {{experience.description}}\n                                         </p>\n                                     </div>\n                                 </div>\n                             </li>\n                         </ul>\n                     </div>\n                 </div>\n                 <div class=\"education\">\n                     <div class=\"title\">\n                         Học Vấn\n                     </div>\n                     <div class=\"education_wrap\">\n                         <ul>\n                             <li *ngFor=\"let education of dataCV.value.educations\">\n                                 <div class=\"li_wrap\">\n                                     <div class=\"date\">\n                     {{education.startDate | date: \'yyyy\'}} - {{education.endDate ? (education.endDate | date: \'yyyy\') : \"Present\"}}\n                                     </div>\n                                     <div class=\"info\">\n                                         <p class=\"info_title\">\n                                             {{education.major}}\n                                         </p>\n                                         <p class=\"info_com\">\n                                             {{education.schoolName}}\n                                         </p>\n                                         <p class=\"info_cont\">\n                                            {{education.description}}\n                                         </p>\n                                     </div>\n                                 </div>\n                             </li>        \n                         </ul>\n                     </div>\n                 </div>\n             </div>\n         </div>\n     </div>\n </div>','https://i.ibb.co/VxcGfqV/Screenshot-2022-06-16-092801.png','2022-04-28 10:25:34.720878',1,NULL,NULL,0,NULL,NULL),(2,'cvTemplate2','  <div class=\"resume\">\n     <div class=\"resume_left\">\n       <div class=\"resume_profile\">\n         <img [src]=\"dataCV.value.file\" alt=\"picture\">\n       </div>\n       <div class=\"resume_content\">\n         <div class=\"resume_item resume_info\">\n           <div class=\"title\">\n             <p class=\"bold\">{{dataCV.value.firstName}} {{dataCV.value.lastName}}</p>\n             <p class=\"regular\">{{dataCV.value.headline}}</p>\n           </div>\n           <ul>\n             <li>\n               <div class=\"icon\">\n                 <i class=\"fas fa-map-signs\"></i>\n               </div>\n               <div class=\"data\">\n                 21 Street, Texas <br /> USA\n               </div>\n             </li>\n             <li>\n               <div class=\"icon\">\n                 <i class=\"fas fa-mobile-alt\"></i>\n               </div>\n               <div class=\"data\">\n                 {{dataCV.value.phoneNumber}}\n               </div>\n             </li>\n             <li>\n               <div class=\"icon\">\n                 <i class=\"fas fa-envelope\"></i>\n               </div>\n               <div class=\"data\">\n                 {{dataCV.value.email}}\n               </div>\n             </li>\n             <li>\n               <div class=\"icon\">\n                 <i class=\"fas fa-calendar\"></i>\n               </div>\n               <div class=\"data\">\n                 {{dataCV.value.birthDate | date: \'dd/MM/yyyy\'}}\n               </div>\n             </li>\n           </ul>\n         </div>\n         <div class=\"resume_item resume_skills\">\n           <div class=\"title\">\n             <p class=\"bold\">Kĩ năng</p>\n           </div>\n           <ul>\n             <li *ngFor=\"let skill of dataCV.value.skills; let i = index\">\n               <div class=\"skill_name\">\n                 {{skill.skillName}}\n               </div>\n               <div class=\"skill_progress\">\n                 <span [style.width.%]=\"skill.level*20 + 20\"></span>\n               </div>\n               <div class=\"skill_per\">{{skill.level*20 + 20}}%</div>\n             </li>\n           </ul>\n         </div>\n         <div class=\"resume_item resume_social\">\n           <div class=\"title\">\n             <p class=\"bold\">Chứng chỉ</p>\n           </div>\n           <ul>\n             <li>\n               <div class=\"icon\">\n                 <i class=\"fab fa-facebook-square\"></i>\n               </div>\n               <div class=\"data\">\n                 <p class=\"semi-bold\">Facebook</p>\n                 <p>Stephen@facebook</p>\n               </div>\n             </li>\n           </ul>\n         </div>\n       </div>\n     </div>\n     <div class=\"resume_right\">\n       <div class=\"resume_item resume_about\">\n         <div class=\"title\">\n           <p class=\"bold\">Giới thiệu</p>\n         </div>\n         <p>{{dataCV.value.description}}</p>\n       </div>\n       <div class=\"resume_item resume_work\">\n         <div class=\"title\">\n           <p class=\"bold\">Kinh nghiệm</p>\n         </div>\n         <ul>\n           <li *ngFor=\"let experience of dataCV.value.experiences\">\n             <div class=\"date\">{{experience.startDate | date: \'yyyy\'}} -\n               {{experience.endDate ? (experience.endDate | date: \'yyyy\') : \"Nay\"}}</div>\n             <div class=\"info\">\n               <p class=\"semi-bold\">{{experience.position}} ({{experience.company}} - {{experience.location}})</p>\n               <p> {{experience.industry ? (\"- Chuyên ngành : \" + experience.industry) : \"\"}}<br>\n                 {{experience.skills ? (\"- Kĩ năng sử dụng : \" + experience.skills) : \"\"}}<br>\n                 {{experience.description}}</p>\n             </div>\n           </li>\n         </ul>\n       </div>\n       <div class=\"resume_item resume_education\">\n         <div class=\"title\">\n           <p class=\"bold\">Học vấn</p>\n         </div>\n         <ul>\n           <li *ngFor=\"let education of dataCV.value.educations\">\n             <div class=\"date\"> {{education.startDate | date: \'yyyy\'}} -\n               {{education.endDate ? (education.endDate | date: \'yyyy\') : \"Nay\"}}</div>\n             <div class=\"info\">\n               <p class=\"semi-bold\"> {{education.major}} ({{education.schoolName}})</p>\n               <p> {{education.description}}</p>\n             </div>\n           </li>\n         </ul>\n       </div>\n       <div class=\"resume_item resume_hobby\">\n         <div class=\"title\">\n           <p class=\"bold\">Hobby</p>\n         </div>\n         <ul>\n           <li *ngFor=\"let hobby of dataCV.value.hobbies\">\n             <div class=\"li_wrap\">\n               <div class=\"text\">{{hobby}}</div>\n           </div>\n           </li>\n         </ul>\n       </div>\n     </div>\n   </div>\n ','https://i.ibb.co/D8wTqn8/Template2.png','2022-04-28 10:25:34.720878',